    <ThemeProvider theme={theme === "light" ? lightTheme : darkTheme}>
    <GlobalStyles />
    <StyledApp>
    <TopBar />
    <Routes>
    <Route exact path="/" element={<Home />} />
    <Route exact path="/coding" element={<Coding />} />
    <Route exact path="/blog" element={<Blog />} />
    <Route exact path="/books" element={<Books />} />
    </Routes>
    <Footer />
    </StyledApp>
    </ThemeProvider>
  );
}

export default App;
